            topic: ["research"],
            title: "Supporting note-taking process in online meetings",
            year: 202208,
            desc: "In meetings, it is difficult to pay attention and take notes at the same time. How can we support the note-taking process to reduce such a burden?",
            link: "https://weblab.mit.edu/winners/",
            image: "projects/notescribe.jpg",
            keywords: ["NLP", "human-AI interaction", "collaboration"],
            prize: {
              name: "3rd Place Winner of MIT Web Lab 2022",
              date: "Jan 2022",
              affiliation: "MIT Web Lab Competition",
              link: "https://weblab.mit.edu/winners/",
            },
            current: !0,
            paragraph:
              "We propose an autocomplete recommendation module that suggests a list of possible words that the user can choose the next word from. The recommendation is based on the data collected from live transcription of the meeting and other metadata that was input by the user such as names of the attendees. We examine multiple ways to show these suggestions in order to find out which kinds of interactions can successfully help reduce the cognitive load of taking notes during a meeting. The image above shows one of the interfaces that we are testing out. The recommendation engine is powered by GPT-3.  ",
